graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "node" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>node</b> <i>&lt;private&gt;</i></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "_InternalHelper" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>_InternalHelper</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];

}
